def _cap(v, low, high):
    if v > high:
        return high
    elif v < low:
        return low
    else:
        return v

def process_line(l, start):
    x, y = start
    for ch in l:
        if ch == 'U':
            y -= 1
        elif ch == 'D':
            y += 1
        elif ch == 'L':
            x -= 1
        elif ch == 'R':
            x += 1
        x = _cap(x, 0, 2)
        y = _cap(y, 0, 2)

    keypad = [['1', '2', '3'],
              ['4', '5', '6'],
              ['7', '8', '9']]
    result = keypad[y][x]
    return result, (x, y)
            
def evaluate(s):
    keys = []
    current = (1, 1)
    for line in s.split('\n'):
        key, current = process_line(line, current)
        keys.append(key)

    return ''.join(keys)

if __name__ == '__main__':
    print(evaluate("""\




"""))
